import React from 'react'
import {Marker, Popup} from 'react-leaflet'
import {IconLocation} from './IconLocation'



const Markers = (props)=> {

    const {data} = props;

    const markers = data.map((gasolinera, i) => (
        /* console.log(gasolinera[i]) */
        <Marker key={i} name = {i} position = {[gasolinera[i].latitud_estacion, gasolinera[i].longitud_estacion]} icon={IconLocation}>
            <Popup>
                <p>
                    Nombre: {gasolinera[i].nombre_estacion} <br/>
                    Direccion: {gasolinera[i].direccion_estacion} <br/>
                    Telefono: {gasolinera[i].telefono_estacion} <br/>
                    Lactitud: {gasolinera[i].latitud_estacion} <br/>
                    Longitud: {gasolinera[i].longitud_estacion} <br/>
                </p>
            </Popup>
        </Marker>
    )); 
    
    console.log(markers)
    return markers;
};

export default Markers
